  return (
    <main>
      <SideNav />
      <section>
        <h1 className="title">Login</h1>

        <div className="login">put pic of user 12 and 18</div>
      </section>

      <article>
        <h3>{users.id}</h3>
      </article>
    </main>
  );
};
